import axiosInstance from "../axiosInstance";
import { SIGN_IN } from "../api";

export const signIn = async (data) => {
  const result = await axiosInstance
    .post(SIGN_IN, data)
    .then((response) => {
      return response;
    })
    .catch((error) => {
      return error;
    });

  return result;
};
